GHSI_table=readtable('GHSI_2021_table.csv');
disp (T_transformed) %[output:4cc319cc]

%%proveravamo da li sve drzave tabele T_transformed postoje u GHSI tabeli
all(ismember(T_transformed.Properties.RowNames,GHSI_table.Country));

%% pokazuje koji redovi nisu isti
setdiff(T_transformed.Properties.RowNames,GHSI_table.Country);

%% menjamo nazive da se poklapaju
GHSI_table.Country{92}='Kyrgyzstan';
GHSI_table.Country{188}='United States';
all(ismember(T_transformed.Properties.RowNames,GHSI_table.Country));

%% izbacujemo redove iz GHSI tabele kojih nema u T_transformed
GHSI_table=GHSI_table(ismember(GHSI_table.Country,T_transformed.Properties.RowNames),:);

%% pravimo isti redosled redova
ciljaniRedosled=T_transformed.Properties.RowNames;
[~,idx]=ismember(ciljaniRedosled,string(GHSI_table.Country));
GHSI_sorted=GHSI_table(idx,:) %[output:5faae6f0]
GHSI_sorted.Properties.VariableNames(2:end)={'Overall','Prevent','Detect','Respond','Health','Norms','Risk'} %[output:9651dc4a]
GHSI_sorted=removevars(GHSI_sorted,'Country') %[output:0108f9f9]

%%
%[text] ## box cox transformacija
GHSI_transformed=GHSI_sorted;
varNames=GHSI_sorted.Properties.VariableNames;
numVars=length(varNames);

for j=1:numVars %[output:group:9f6c1fe9]
    [GHSI_transformed{:,j}]=boxcox(GHSI_sorted{:,j});
    s=skewness(GHSI_transformed{:,j}) %[output:63637180] %[output:41df1189] %[output:5bf30599] %[output:7d78778f] %[output:80e155e0] %[output:20dc7cfc] %[output:91232e39]
    figure %[output:6710b961] %[output:7d93fd9a] %[output:22d4bc4c] %[output:3e4b5feb] %[output:53db9230] %[output:72aaa190] %[output:3f80658b]
    subplot(1,2,1) %[output:6710b961] %[output:7d93fd9a] %[output:22d4bc4c] %[output:3e4b5feb] %[output:53db9230] %[output:72aaa190] %[output:3f80658b]
    histogram(GHSI_sorted{:,j})
    title(['Pre transformacije ',varNames{j}])
    subplot(1,2,2)
    histogram(GHSI_transformed{:,j})
    title(['Posle transformacije ',varNames{j}])
end %[output:group:9f6c1fe9]
disp(GHSI_transformed) %[output:86debb21]
idx=isoutlier(GHSI_transformed(:,2:end));

T_transformed=addvars(T_transformed,GHSI_transformed.Overall,GHSI_transformed.Prevent,GHSI_transformed.Detect,GHSI_transformed.Respond,GHSI_transformed.Health,GHSI_transformed.Norms,GHSI_transformed.Risk,'Before','R_mean') %[output:6795465c]








